import React from 'react';

class BookItem extends React.Component {
    render() {
        const { title, volumeInfo } = this.props.book;
        return (
            <img className="thumb"
                alt={title}
                src={volumeInfo.imageLinks.thumbnail}
            />
        );
    }
}

export default BookItem;
